<?php

namespace App\Http\Controllers\SnapFanCards;

use App\Http\Controllers\Controller;
use Illuminate\Http\Request;

class SnapFanCards extends Controller
{
    public function page(
        Request $request
    ) {
        // Interestingly, saying page 0 redirects to the main page
        //  I'm not sure how to intercept this
        $request->validate([
            'page' => [
                'integer',
                'gt:0',
                'lte:9',
            ],
        ]);
        $args = $request->only('page');
        $page = $args['page'];

        $pageMethod = "page{$page}";
        if (method_exists($this, $pageMethod)) {
            return call_user_func([$this, $pageMethod]);
        }

        return null;
    }

